import { useContext } from "react"
import { AuthProvider } from "../../context/AuthContext"

const Home = () => {

    const { citys } = useContext(AuthProvider)

    return (
        <main>
            <div>
                <input type='text'></input>
                <button></button>
            </div>
            <div>
                <h1>Cidades Existentes</h1>
                <ul>
                {
                    citys.map(city =>
                        <li>
                                Nome: {city.name}
                                <button>Verificar</button>
                            </li>
                        )
                    }
                </ul>
            </div>
        </main>
    )
}

export default Home
